import packageImg from '../img/package.JPG'


function Projects () {
    let projectsList = []
    let state = 0

    if (projectsList.length) {
        state = 1
    }
    return (
        <div className='projects'>
            {state ? <div></div> : <img src={pack}></img>}
        </div>
    )
}

export default Projects
